/**
 * 种子杯网站首页
 * @file seed.js
 * @author 
 * @copyright 
 * @createDate 2020-12-15
 */

import React from 'react'
import { Link } from 'react-router-dom'
import Banner from "../../img/BANNER.png"
import seedlogo from "../../img/seedlogo.png"

class Seed extends React.Component{
    render() {
        return(
            <div style={{position: "relative"}}>
                <img src={Banner} alt="logo" className="logo" style={{position: "relative", left: "0", top: "0", backgroundSize: "cover", width: "100%", height:"100%"}}/>
                <img src={seedlogo} alt="seedlogo" className="seedlogo" style={{position: "relative", left: "20px", top: "20px"}}/>
                <h1>This is Index Page!</h1>
                <ul role="nav">
                    <li><Link to="/signin">sign in</Link></li>
                    <li><Link to="/signup">sign up</Link></li>
                </ul>
                {this.props.children}
            </div>
        )
    }
};

export default Seed;
